/**
 * Different calendar types.
 *
 * @public
 */
enum CalendarType {
	/**
	 * @public
	 */
	Gregorian = "Gregorian",
	/**
	 * @public
	 */
	Islamic = "Islamic",
	/**
	 * @public
	 */
	Japanese = "Japanese",
	/**
	 * @public
	 */
	Buddhist = "Buddhist",
	/**
	 * @public
	 */
	Persian = "Persian",
}

export default CalendarType;
